import React, { props } from "react";
import Kartica from "./Kartica";

export default function Prikazivanje(props) {
  let alo = props.podaci.data;
  console.log(alo);
  return (
    <div className="grid">
      {alo.map((artikal, id) => {
        return <Kartica osoba={artikal}></Kartica>;
      })}
    </div>
  );
}
